'use strict';

var network;
$(document).ready(function ()
{

    var promise = new Promise((resolve, reject) =>
    {

        $.getJSON("./nerual_network/network.json", function (json)
        {
            resolve(json);
        });


    });

    promise
        .then(
            responseNetwork =>
            {
                network = responseNetwork;
                var carFormModel = new CarFormModel();
                var carFormView = new CarFormView({model: carFormModel});

                return  getResultNetwork({time:7, weight:1000}, network);
            }
        )
        


});


function getResultNetwork(input, networkJSON)
{
    //BEGIN preparation

    var maxValueObj = networkJSON.maxValueObj;
    var net = new brain.NeuralNetwork().fromJSON(networkJSON);
    net.fromJSON(networkJSON);

    //END preparation

    //BEGIN normalize input
    for (var key in input) {
        if (input.hasOwnProperty(key))
        {
            input[key] /= maxValueObj[key];
        }
    }
    //END normalize input
    var resultNetwork = net.run(input);
    //BEGIN normalize output
    for (key in resultNetwork) {
        if (resultNetwork.hasOwnProperty(key))
        {
            resultNetwork[key] *= maxValueObj[key];
        }
    }
    //END normalize output
    return resultNetwork;

}
var CarFormModel = Backbone.Model.extend({

    defaults: {
        "carWeight":  1100,
        "carTime":     9,
        "carPower":    98
    },

    initialize: function() {
        this.on('change:carWeight change:carTime', this.changeModel)
    },

    changeModel:function ()
    {
        let carWeight = this.get('carWeight');
        let carTime = this.get('carTime');
        let carPower = getResultNetwork({time:carTime, weight:carWeight}, network).hp;
        this.set({'carPower':carPower});
    }

});
/**
 * Created by Daniil on 11.10.2016.
 */
var CarFormView = Backbone.View.extend({

    el: "#carForm",

    events: {
        "keyup #carWeight, #carTime":   "changeInput",
        "change #carWeight, #carTime":   "changeInput"
    },

    initialize: function() {

        this.listenTo(this.model, "change:carPower", this.renderPower);

    },

    changeInput:function (e)
    {
        var elem =  $(e.target);

        let carOptionName = elem.attr('id');

        let tempObj = {};
        tempObj[carOptionName] = elem.val();

        this.model.set(tempObj);
    },

    renderPower:function ()
    {
        let carPower = this.model.get('carPower');
        this.$('#carPower').text(parseInt(carPower)+' Hp');

    }

});
